import React from "react";

const Contact = () => {
  return (
    <div className="portfolio">
      <div className="container mx-auto max-w-7xl px-2 sm:px-6 lg:px-8">
        <div className="-mx-4 flex  flex-wrap">
          <div className="w-full px-4">
            <div className=" mb-12 text-center mx-auto max-w-[510px] item-center lg:mb-20 ">
              <h2 className="text-5xl portfolio-text">Contact With Me</h2>
            </div>
          </div>
        </div>
      </div>
      <div className="group-2 flex justify-center items-center">
        <div className=" portfolio-card w-[432px] h-[672px] rounded-3xl mr-[38px] p-4 ">
          <div className="rectangle-3-2 w-[383px] h-[228px] rounded-3xl bg-gray-300 mt-4"></div>
        </div>
        <div className="f-o-r-m w-[762px] h-[672px]">
          <div className="group-3 w-full h-full">
            <div className="rectangle-3-0 rounded-3xl w-full h-full bg-gray-300">
              {" "}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
